
DROP TABLE IF EXISTS kanjidic2;
CREATE TABLE kanjidic2 (
  id int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
  utf varchar(32) NOT NULL,
  kanji varchar(2) NOT NULL,
  strokes TINYINT NOT NULL,
  grade TINYINT,
  meanings TEXT,
  ja_on TEXT,
  ja_kun TEXT,
  UNIQUE KEY utf (utf),
  KEY kanji (kanji),
  key strokes (strokes)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

